use practice;
CREATE TABLE electronics_products (
    Product_Name VARCHAR(512) NOT NULL,
    Price INT NOT NULL,
    Rating DECIMAL(2, 1) NOT NULL,
    Review_Count INT NOT NULL,
    ASIN VARCHAR(20) PRIMARY KEY, -- ASIN is a good candidate for the primary key
    Product_URL VARCHAR(2048) NOT NULL,
    Availability VARCHAR(100)
);


#Descriptive Statistics
SELECT
    -- Count of non-null values for each metric
    COUNT(Price) AS Price_Count,
    COUNT(Rating) AS Rating_Count,
    COUNT(Review_Count) AS Review_Count_Count,

    -- Price Statistics
    MIN(Price) AS Price_Min,
    MAX(Price) AS Price_Max,
    AVG(Price) AS Price_Mean,
    STDDEV(Price) AS Price_StdDev,

    -- Rating Statistics
    MIN(Rating) AS Rating_Min,
    MAX(Rating) AS Rating_Max,
    AVG(Rating) AS Rating_Mean,
    STDDEV(Rating) AS Rating_StdDev,

    -- Review Count Statistics
    MIN(Review_Count) AS Review_Count_Min,
    MAX(Review_Count) AS Review_Count_Max,
    AVG(Review_Count) AS Review_Count_Mean,
    STDDEV(Review_Count) AS Review_Count_StdDev

FROM
    electronics_products;   
    
#Observations:
#1. The vast majority of the 9,000+ products are low-to-mid-cost accessories and gadgets. 
#2. A small number of expensive items (e.g., high-end phones, TVs) heavily skew the mean upwards. 
#3. Customer satisfaction is generally high and consistent across the category. 
#4. Products with very low ratings are rare or not well-represented in this dataset.   
#5. Popularity is highly concentrated. 
#6. A small set of blockbuster products (e.g., best-selling phones, headphones, or accessories) have massive review counts. 
#7 While the typical product has far fewer reviews.
 
#Top-Rated Products
SELECT
    Product_Name,
    Price,
    Rating,
    Review_Count
FROM
    electronics_products
WHERE
    Review_Count >= 50 -- Filter for products with a reliable number of reviews
ORDER BY
    Rating DESC, -- Sort by highest rating first
    Review_Count DESC -- Use review count as a tie-breaker
LIMIT 10;

#Observations:
#High End Phones Dominate High Ratings: The very top-rated products often include high-cost, high-value items like mobile phones and
#accessories. These items frequently achieve a high 4.5 rating.
#Top 10 includes Repeat Products: Due to slight variations in listings or data collection, you might see the same or nearly identical product 
#appear multiple times in the top results.

#Products with Most Reviews
SELECT
    Product_Name,
    Price,
    Rating,
    Review_Count
FROM
    electronics_products
ORDER BY
    Review_Count DESC
LIMIT 10;

#Observations:
#Focus on Mass-Market Items: This list is overwhelmingly populated by products that appeal to the broadest consumer base, such as TWS earphones, 
#basic smartwatches, mobile chargers, and HDMI cables.
#Correlation with Price: The most-reviewed products are usually low-to-mid-priced items. 
#These products have a faster turnover and wider adoption, leading to exponential review growth compared to high-end, niche equipment.

#Rating Distribution Analysis
SELECT
    -- Round the rating to one decimal place for grouping
    ROUND(Rating, 1) AS Rounded_Rating,
    COUNT(ASIN) AS Product_Count,
    -- Calculate the average price for products in this rating group
    AVG(Price) AS Average_Price
FROM
    electronics_products
WHERE
    Rating IS NOT NULL
GROUP BY
    Rounded_Rating
ORDER BY
    Rounded_Rating DESC;
    
#Observations:
#The Bulk of Products are Good: The highest Product_Count will be found in the rating range of 4.0 to 4.5. 
#This confirms that the average Amazon electronics product is well-received.    
#Low Ratings and 5.0 are Rare: The number of products with very low ratings (e.g., 1.0 to 3.0) 
#and perfect 5.0 ratings will be significantly smaller than the 4.0 to 4.5
#Products with very low ratings (e.g., $2.0$-$3.0$) tend to have a low average price, suggesting poor quality in the budget segment.
#The highest average prices are usually found in the excellent rating range ($4.4$-$4.7$), indicating that consumers are willing to pay a premium 
#for high-quality, well-reviewed electronics.
    
#Identifying the Most Expensive and Cheapest Items
#Most Expensive:
    SELECT
    Product_Name,
    Price
FROM
    electronics_products
ORDER BY
    Price DESC
LIMIT 1;

#Cheapest:
SELECT
    Product_Name,
    Price
FROM
    electronics_products
ORDER BY
    Price ASC
LIMIT 1;
